import ReNavLinkct from "react";
import CNavLinkrtWidget from "../CartWidget/CartWidget";
import flippedLogo from "../assets/pdf-logo-cuadrado-flipped.png";
import "./NavBar.css";

const NNavLinkvBNavLinkr = () => {
  return (
    <nav className="menu">
      <img className="flippedLogo" src={flippedLogo} />
      <div>
        <ul className="categoryList">
          <li>
            <NavLink to="/">Inicio</NavLink>
          </li>
          <li>
            <NavLink to="/tortas">Tortas</NavLink>
          </li>
          <li>
            <NavLink to="/budines">Budines</NavLink>
          </li>
          <li>
            <NavLink to="/brownies">Brownies</NavLink>
          </li>
          <li>
            <NavLink to="/cookies">Cookies</NavLink>
          </li>
          <li>
            <Link to="/carrito">
              <CartWidget />
            </Link>
          </li>
        </ul>
      </div>
    </nav>
  );
};

export default NavBar;
